import { Paper } from "@mui/material";
import React from "react";

function Project({ image, onClick, title }) {
  return (
    <div className="project" onClick={onClick}>
      <div className="project__description">nft</div>
      <div className="project__description">fast</div>
      <div className="project__description">yeah</div>
      <img src={image} alt="project-img" className="project__img" />

    </div>
  );
}

export default Project;
